            "text": "## Description\nEmerald Playa Beach is a popular kite spot due to its beautify scenery, tourist friendly accommodations,  local kite shop, and good kiting conditions. \n\n## Getting There\nAfter flying into Puerto Princessa airport, it takes over 30 minutes of dirt roads to get to this spot. This is a bit too long for hopping into a trike. If you are staying in the Microtel, they can arrange for a free shuttle ride. Otherwise, you might try grabbing a taxi at the airport, but make sure to negotiate the price.\n\n## Accomodations\nEmerald Beach is pretty far outside of town, which significantly limits the options for those without transportation. The Microtel is a great choice for those on vacation who want the amenities offered by the hotel, such as an amazing complimentary breakfast, pool, and airport shuttle. For those looking for a more authentic and cheaper alternative, there is a cluster of small cabins adjacent to the Microtel that are available to rent through popular online booking sites. These cabins, while small, are a great get-away experience for couples and include air-conditioning, plumbing, and incredible wifi! \n\n## Kite Club Palawan\nThe kite club sits right on the beach, directly in-between the Microtel and cabins. They offer affordable lessons, but the gear rental is pricy. Even if you are not employing their service, they are usually generous enough to loan you a pump and even have a local person to help you launch/land your kite free of charge.\n\n## Conditions\nThe water is shallow in a large region around the beach, with a noticeable shift in tint as you move out to deeper parts. Not every day at Emerald Beach is a kiting day. However, during the windy season, you can expect at least a few good kiting days per week with consistent wind and kite sizes between 9-14m. In fact, the wind around Peurto Princessa tends to be better than that found on the north side of Palawan due to the lack of neighboring islands in this area, which allows wind to flow unobstructed.\n\n## Hazards\nThe biggest concern while kiting is to avoid the rocky areas. There is a large rocky area on the north side of the beach, so be sure to ask locals to point it out before launching. There are also other obstacles such as boats and sand-bars to watch out for. Sea urchins are a known issue in the area, although they are typically only encountered in deeper water. Booties are recommended. \n\n",
