            "text": "## Description\nSkyway is primary destination for kiters around the St. Petersburg area. This spot sits on the west side of Skyway bridge in a wooded rest area.\n\n## Getting There\nIf you are traveling south on Skyway bridge, this spot is situated in the first rest area after the toll booth. Its possible to see kites out on the water while driving on the bridge. Even if there are signs that say that the rest area is closed, you can still exit. After exiting, there is an intersection that goes either to the west side or the east side. Drive all the way down the service road on the west side, and the road will end at a small beach. You can park off the beach or anywhere in the wooded area.\n\n## Launching\nThe launch area is a relatively small beach, and this spot can get very crowded on a windy day. Luckily, its usually only kiters here, without too many other beach goers. Try to get rigged up and launched quickly before someone lays their lines over yours.\n\n## Water\nThe kiteboarding area is large, including the entire region around the rest area and stretching out further beyond the channel if you want more space. The bottom is mostly muddy with an occasional sand bar. The protection inside the bay and these sand bars keeps the water relatively flat and shallow around the rest area.\n\n## Wind\nAs one would expect, the west side of Skyway is best on a west wind. For south-west it can be good, but its a toss-up between this spot and Fort Desoto, depending on exactly how westerly the wind is. For a north-west wind, it can also work, but there is a large island just north-west of this spot that can cause obstruction or a wind-shadow. For any winds from the east, head across the street to the east side of Skyway.\n\n",
