            "text": "## Description\nThis bay area bordered by the Big Sabine peninsula is frequently a hot spot for local kiterboarders. It is the most popular spot on the sound-side of Pensacola Beach and often referred to as simply, \"Big Sabine\".\n\n## Getting There\nDrive down Pensacola Beach until you see the \"Welcome to Pensacola Beach\" sign. Here, you can park on the side of the road. However, be careful of deep sand, because your vehicle can easily get stuck. There are usually small patches of gravel where the sand is shallow and safe to park. It is a short walk out to the bay.\n\n## Launching\nThis area is typically free of beach-goers. The beach at the waters edge is small without much space to launch. Most kiters will rig, launch, and land in the large sandy space just south of the water. However, the sand is covered with small, sharp seashells. Self-launching directly off the sand is not advisable, as they will rip through the leading edge. Alternatively, there is a small path through the west side that leads out to a sand bar. While the size of the sand bar depends on conditions (and the last hurricane), it may be big enough to use for self-launching.\n\n## Wind\nThis spot is great for an on-shore northerly or easterly wind. Its even better with an offshore wind from the south-east. Even with a off-shore wind, this spot is generally safe to kite due to the shallow water and down-wind protection of Big Sabine point. Kiters experienced with staying upwind can enjoy the smooth surf of an off-shore wind with the peace-of-mind offered by the sand bars. Wind directly from the west is likely to get severely obstructed as it makes its way over land and large sand dunes.\n\n## Precautions\nDespite the shallow water of Big Sabine Point, there is a deep channel that cuts right in front of the beach, visible from the map. This water is too deep to stand and may cause difficulty for beginners. Small jelly fish can be a nuisance depending on the season. Keep an out for the large man-o-war jelly fish. Although they are normally only found in the gulf, they have spotted in bay waters as well. Sting rays are a constant hazard and may attack if threatened. Booties are recommended, especially due to the shells on the beach. Do not walk/jump/launch on dunes, as this area is preserved for local wildlife, and their nesting areas should not be disrupted.\n\n## Lessons\nIf you are looking for kiteboarding instruction in the area, give Jon Davies a call at (904) 868-1141. He is a local expert and has been teaching beginners to advanced kiters for many years. Let him know if you are in the market for some new gear.\n\n",
