            "lat": 30.6276273986509,
            "text": "## Description\nThis bayside beach in Daphne is accessible through park nature trails and is commonly referred to by local kiteboarders as Daphne Nature Trail.\n\n## Getting There\nThere are three trails that can be used to accessed the beach. The closest begins in the parking lot in Bayfront Park. However, as of March 2018, this trail is closed for repairs to a bridge. There is also a parking lot entrance at Village Point. While the hike through the woods is easy, it is about 15 minutes walk to the beach, so don't forget your pump. Both of these lots offer free parking. There is a third entrance at the cul-de-sac in the Harbor Place neighborhood. However, this entrance is gated and only accessible by Harbor Place residents. \n\n## Wind\nThis spot is best for kiteboarding wind from the west. An offshore wind will be gusty and could leave you stranded in Mobile Bay. One could walk south from the pier to where the beach curves around, which might be good for a southerly wind. However, there are lots of broken piers and posts in the water in that area. Also, the southern part of the beach is mostly private.\n\n## Precautions\nThis beach is not an incredibly popular destination for local beach goers, but remember that pedestrians always have the right of way. Also, keep an eye out for gators, which frequent the eastern shore side of the bay.\n\n",
