            "lng": -82.0158976992916,
            "lat": 26.4529366159131,
            "text": "## Description\nThe lighthouse on the point of Sanibel Island features great beaches on all sides of the peninsula.\n\n## Parking\nThere are parking lots on the north and south side of the point. Parking is expensive, $5 per hour. \n\n## Kiting\nThe lighthouse is best for a north-east wind. However, the beach goes all the way around, so this spot could work for any wind except westerly. The beach can get very crowded with beach-goers, especially the southern beach.\n\n## Ammenities\nThere are nice bathrooms and showers in the southern parking lot.\n\n",
